'''TzHaar-Hur-Rin''' owns the [[TzHaar-Hur-Rin's Ore and Gem Store|Ore and Gem Store]] in [[Mor Ul Rek#Inner Area|Mor Ul Rek]]. It is also one of the few NPCs to sell uncut [[Onyx]] and [[Onyx bolt tips]], the other being [[TzHaar-Hur-Lek]].

